import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

const ResultsPage = () => {
  const [results, setResults] = useState([]);
  const [cumulativeScores, setCumulativeScores] = useState([]);
  const [selectedWeek, setSelectedWeek] = useState(1);
  const [weeksAvailable, setWeeksAvailable] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    fetch(`/api/scores/${selectedWeek}`)
      .then((res) => res.json())
      .then((data) => setResults(Array.isArray(data) ? data : []))
      .catch((err) => {
        console.error('Error fetching weekly results:', err);
        setResults([]);
      });
  }, [selectedWeek]);

  useEffect(() => {
    fetch(`/api/cumulative-scores`)
      .then((res) => res.json())
      .then((data) => {
        if (Array.isArray(data)) {
          const sorted = [...data].sort((a, b) => b.totalScore - a.totalScore);
          setCumulativeScores(sorted);
        } else {
          setCumulativeScores([]);
        }
      })
      .catch((err) => {
        console.error('Error fetching cumulative scores:', err);
        setCumulativeScores([]);
      });
  }, []);

  useEffect(() => {
    const maxWeeks = 18;
    const available = [];
    for (let i = 1; i <= maxWeeks; i++) {
      available.push(i);
    }
    setWeeksAvailable(available);
  }, []);

  return (
    <div className="p-6 max-w-4xl mx-auto font-sans">
      <h2 className="text-3xl font-bold text-center mb-6">üèà Results for Week {selectedWeek}</h2>

      <div className="mb-6 text-center">
        <label className="mr-2 font-semibold text-lg">Select Week:</label>
        <select
          className="border px-3 py-2 rounded shadow-sm"
          value={selectedWeek}
          onChange={(e) => setSelectedWeek(Number(e.target.value))}
        >
          {weeksAvailable.map((week) => (
            <option key={week} value={week}>
              Week {week}
            </option>
          ))}
        </select>
      </div>

      <div className="space-y-6 mb-10">
        {results.length === 0 ? (
          <p className="text-center text-gray-500 italic">No results available for this week.</p>
        ) : (
          results.map((player, index) => (
            <div
              key={index}
              className="border rounded-xl p-4 shadow-md bg-white"
            >
              <h3 className="text-xl font-semibold mb-2 flex items-center">
                <span className="mr-2">{player.name}</span>
                <span className="text-gray-600">‚Äî Score: {player.score}/10</span>
                {player.score >= 9 && (
                  <span className="ml-3 text-yellow-500 text-lg animate-pulse">‚≠ê Awesome Picks!</span>
                )}
              </h3>
              <ul className="list-disc list-inside ml-4 space-y-1">
                {(player.picks || []).map((pick, idx) => (
                  <li key={idx} className={pick.correct ? 'text-green-600' : 'text-red-600'}>
                    {pick.team} {pick.correct ? '(Correct)' : '(Wrong)'}
                  </li>
                ))}
              </ul>
            </div>
          ))
        )}
      </div>

      <div className="mt-12 bg-gray-50 rounded-xl p-6 shadow-inner">
        <h2 className="text-2xl font-bold mb-4 text-center">üèÜ Cumulative Scores</h2>
        <table className="w-full table-auto border-collapse text-center text-base">
          <thead>
            <tr className="bg-gray-100">
              <th className="border px-4 py-2">Player</th>
              <th className="border px-4 py-2">Total Score</th>
            </tr>
          </thead>
          <tbody>
            {cumulativeScores.map((player, idx) => (
              <tr key={idx} className="hover:bg-gray-50">
                <td className="border px-4 py-2">{player.playerName}</td>
                <td className="border px-4 py-2">{player.totalScore}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <div className="text-center mt-10">
        <button
          onClick={() => navigate('/')}
          className="bg-blue-600 text-white px-6 py-2 rounded-full shadow hover:bg-blue-700 transition"
        >
          üîô Back to Make Picks
        </button>
      </div>
    </div>
  );
};

export default ResultsPage;
